import Java from "../../components/JavaEdit/index";
import { generator } from "../../api/generator/generator";
export default {
  name: 'Preview',
  components: {
    Java: Java
  },
  data: function data() {
    return {
      data: null,
      height: '',
      activeName: 'Entity'
    };
  },
  created: function created() {
    var _this = this;

    this.height = document.documentElement.clientHeight - 180 + 'px';
    var tableName = this.$route.query.tableName;
    generator(tableName, 1).then(function (data) {
      _this.data = data;
    }).catch(function (err) {
      _this.$message.error(err);

      _this.$router.go(-1);
    });
  }
};
